export default function ChengduTaste() {
    return (
        <div className="chengdu-taste">
            <h1> Chengdu Taste </h1>
            <p> Chengdu Taste is a restaurant located in the heart of downtown San Francisco. It is a family owned restaurant that serves authentic Sichuan cuisine. </p>
            <p> I was hired as a part-time web developer to help the restaurant with their website. The website was built using React.js and hosted on Netlify. </p>
            <p> The website is still under construction. </p>
            <a href="https://chengdu-taste.netlify.app/" target="_blank" rel="noopener noreferrer"> Chengdu Taste </a>
        </div>
    );
}
